import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
    faYoutube,
    faFacebook,
    faTwitter,
    faInstagram
  } from "@fortawesome/free-brands-svg-icons";

const iconStyle = {
    fontSize : "50",
};

const SocialNetwork = ()=>{
    return (
        <>
            <div className="social-container">
                <h3>Social Follow</h3>
            </div>
        </>
    );
};

export default SocialNetwork;
